DROP TABLE IF EXISTS `gate_project`;
CREATE TABLE `gate_project` (
  `id` varchar(36) NOT NULL,
  `code` varchar(20) NOT NULL COMMENT '项目编号，如BI, TW, INTIME, ADMIN 等',
  `name` varchar(30) NOT NULL COMMENT '项目名称',
  `protocol` varchar(20) NOT NULL DEFAULT 'https' COMMENT '访问协议',
  `domain` varchar(30) NOT NULL COMMENT '访问主域名，如 bi.simuyun.com',
  `managers` varchar(400) DEFAULT NULL COMMENT '该项目负责人手机号，使用逗号隔开',
  `storage` text,
  `remark` varchar(1000) DEFAULT NULL,
  `is_disabled` varchar(2) DEFAULT '0',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `create_user_id` varchar(40) DEFAULT NULL COMMENT '创建用户ID',
  `create_user_name` varchar(40) DEFAULT NULL COMMENT '创建用户姓名',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `update_user_id` varchar(40) DEFAULT NULL COMMENT '修改用户ID',
  `update_user_name` varchar(40) DEFAULT NULL COMMENT '修改用户姓名',
  `data_version` int(5) DEFAULT '0' COMMENT '用于乐观锁',
  `is_delete` varchar(1) DEFAULT '0' COMMENT '0未删除、1已删除',
  `data_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '数据时间戳-数据库托管',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

