DROP TABLE IF EXISTS `gate_resource`;
CREATE TABLE `gate_resource` (
  `id` varchar(36) NOT NULL,
  `parent_id` varchar(36) DEFAULT '0' COMMENT '父类资源ID',
  `project_id` varchar(36) DEFAULT NULL,
  `type` varchar(20) DEFAULT NULL COMMENT '资源类型 1：模块 ；2：页面；3：动作',
  `name` varchar(100) DEFAULT NULL COMMENT '资源名称',
  `icon` varchar(4) DEFAULT NULL COMMENT '图标码',
  `method` varchar(6) DEFAULT NULL COMMENT '资源方法  GET、POST、DELETE、PETCH',
  `path` varchar(100) DEFAULT NULL COMMENT '资源URL',
  `sort` bigint(11) DEFAULT NULL COMMENT '该资源在父资源下的序列号',
  `is_disabled` varchar(2) DEFAULT '0',
  `auth_mode` varchar(2) DEFAULT NULL,
  `remark` varchar(200) DEFAULT NULL COMMENT '备注',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `create_user_id` varchar(40) DEFAULT NULL COMMENT '创建用户ID',
  `create_user_name` varchar(40) DEFAULT NULL COMMENT '创建用户姓名',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `update_user_id` varchar(40) DEFAULT NULL COMMENT '修改用户ID',
  `update_user_name` varchar(40) DEFAULT NULL COMMENT '修改用户姓名',
  `data_version` int(5) DEFAULT '0' COMMENT '用于乐观锁',
  `is_delete` varchar(1) DEFAULT '0' COMMENT '0未删除、1已删除',
  `data_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '数据时间戳-数据库托管',
  `region` varchar(50) DEFAULT NULL COMMENT '区，主要是用来标记哪些资源可在该区访问',
  PRIMARY KEY (`id`),
  KEY `idx_pid` (`project_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

